textOriginal:
Vamos aos fatos:
 Sim, grande parte da galera realmente é ciumenta;
 Vó nunca mente, isso é fato;
 Os outros 2 nem aparece;
 O PM claramente agride o amigo dele;
 O PM tava embreagado.
 Se a familia fala que ele estuda e a policia fala que nao, que tem varias passagens e é criminoso é facil ue, é documento publico, é só ver se o cara estuda em alguma faculdade ou se tem descendentes criminais.
